import React from 'react';
import NavBar from '../Components/navbar';
import "./pagestyle.css";


function OW() {
  return (
  	<div>
    	<NavBar />
    	<div class="overwatch">
    		Overwatch
    	</div>
    </div>
  );
}

export default OW;
